async function PostGithubPRComment(input, contents) {
  try {
    const { owner, repo } = input.gitContext.repo;
    const pull_number = input.gitContext.issue.number == void 0 ? 4 : input.gitContext.issue.number;
    const comments = await input.octokit.rest.issues.listComments({
      owner,
      repo,
      issue_number: pull_number
    });
    console.log("list comments status : " + comments.status);
    console.log(comments.data);
    const searchString = "[[this comment is create by github atcions c6856956214ab4a9b4da8d436185b983]]";
    const filtered_comment = comments.data.filter((comment) => {
      return comment.body?.includes(searchString);
    });
    console.log("filtered_comment : " + filtered_comment.length);
    if (filtered_comment.length == 0) {
      console.log("No comment found");
      input.octokit.rest.issues.createComment({
        owner: input.gitContext.repo.owner,
        repo: input.gitContext.repo.repo,
        issue_number: pull_number,
        body: contents + "\n" + searchString
      });
    } else {
      console.log("Comment found");
      input.octokit.rest.issues.updateComment({
        owner,
        repo,
        issue_number: pull_number,
        comment_id: filtered_comment[0].id,
        body: contents + "\n" + searchString
      });
    }
  } catch (error) {
    if (error instanceof Error) throw new Error(`Error adding comment: ${error}`);
  }
  return;
}

// src/utilities.ts
function CreateMarkDownContents(findings) {
  let markdownContent = `# Vulnerability Report

`;
  markdownContent += `| Title | Description | Severity | Inspector Score | Exploit Available | Fix Available |Status |
`;
  markdownContent += `|-------|-------------|----------|-----------------|-------------------|---------------|--------|
`;
  findings.forEach((finding) => {
    markdownContent += `| ${finding.title} | ${finding.description} | ${finding.severity} | ${finding.inspectorScore} | ${finding.exploitAvailable} | ${finding.fixAvailable} |  ${finding.status} |
`;
  });
  findings.forEach((finding) => {
    markdownContent += `
### Resources for ${finding.title}
`;
    markdownContent += `| Resource Type | Resource ID | Region |
`;
    markdownContent += `|---------------|-------------|--------|
`;
    finding.resources?.forEach((resource) => {
      markdownContent += `| ${resource.type} | ${resource.id} | ${resource.region} |
`;
    });
    if (finding.remediation) {
      markdownContent += `
### Remediation for ${finding.title}
`;
      markdownContent += `| Recommendation | More Info |
`;
      markdownContent += `|----------------|-----------|
`;
      markdownContent += `| ${finding.remediation.recommendation?.text || "N/A"} | [Link](${finding.remediation.recommendation?.Url || "#"}) |
`;
    }
    markdownContent += `
---

`;
  });
  return markdownContent;
}

